export default function SearchBar({onSearch}) {
   const [id,setID] = useState('')


   const handleChange = (e) => {
      setID(e.target.value)
      console.log(id);
   }

   return (
      <div>
         <input type='search' onChange={handleChange} value={id}/>
         <button onClick={onSearch}>Agregar</button>
      </div>
   );
}
